const expect = require('expect');
const request = require('supertest');
const {ObjectID} = require('mongodb');

const {app} = require('./../server.js');
const {File} = require('./../models/File.js');

const testFiles = [{
	_id: new ObjectID(),
	dataURL: "data:image/png;base64,",
},
{
	_id: new ObjectID(),
	dataURL: "data:image/png;base64,"
}];


beforeEach(done => {
	File.deleteMany().then(() => {
		return File.insertMany(testFiles)
	}).then(() => done())
	.catch(done);
});

describe('POST /files', () => {
	it('should create a new file', done => {
		let dataURL = "data:image/png;base64,";
		request(app)
		.post('/files')
		.send({dataURL})
		.expect(200)
		.expect(res => {
			expect(res.body.dataURL).toBe(dataURL)
		})
		.end((err, res) => {
			if(err) {
				return done(err);
			}
			File.find().then(files => {
				expect(files.length).toBe(3);
				expect(files.reverse()[0].dataURL).toBe(dataURL);
				done();
			}).catch(e => done(e));
		});
	});
	it('should no create a file with invalid body data', done => {
		let test = {};
		request(app)
		.post('/files')
		.send(test)
		.expect(400)
		.end((err, res) => {
			if(err) {
				return done(err);
			}
			File.find().then(files => {
				expect(files.length).toBe(2);
				done()
			}).catch(done);
		})
	});
});

describe('GET /files/:id', () => {
	it('should return the correct file', done => {
		let id = testFiles[0]._id.toHexString();
		request(app)
		.get(`/files/${id}`)
		.expect(200)
		.expect(res => {
			expect(res.body.file.dataURL).toBe(testFiles[0].dataURL);
		})
		.end(done);
	});
	it('should return 404 if not found', done => {
		let id = new ObjectID().toHexString();
		request(app)
		.get(`/files/${id}`)
		.expect(404)
		.end(done);
	});
	it('should return 404 for non-valid ObjectID', done => {
		let id = 'NotValidObjectID';
		request(app)
		.get(`/files/${id}`)
		.expect(404)
		.end(done);
	});
});

describe('PATCH /files/:id', () => {
	it('should update the file', done => {
		let id = testFiles[1]._id.toHexString();
		let dataURL = "data:image/png;base64,";
		request(app)
		.patch(`/files/${id}`)
		.send({dataURL})
		.expect(200)
		.expect(res => {
			expect(res.body.file.dataURL).toBe(dataURL);
		})
		.end((err, res) => {
			if(err) {
				return done(err);
			}
			File.findById(id).then(file => {
				expect(file.dataURL).toBe(dataURL);
				done()
			}).catch(done);
		})
	});
	it('should return 404 if file not found', done => {
		let id = new ObjectID().toHexString();
		let dataURL = "data:image/png;base64,";
		request(app)
		.patch(`/files/${id}`)
		.send({dataURL})
		.expect(404)
		.end(done);
	});
	it('should return 404 for non-valid ObjectID', done => {
		let id = 'NotValidObjectID';
		let dataURL = "data:image/png;base64,";
		request(app)
		.patch(`/files/${id}`)
		.send({dataURL})
		.expect(404)
		.end(done);
	})
});
describe('DELETE /files', () => {
	it('should remove the file', done => {
		let id = testFiles[0]._id.toHexString();
		request(app)
		.delete(`/files/${id}`)
		.expect(200)
		.expect(res => {
			expect(res.body.file._id).toBe(id);
		})
		.end((err, res) => {
			if(err) {
				return done(err);
			}
			File.findById(id)
			.then(file => {
				expect(file).toBeNull();
				done()
			}).catch(done);
		});
	});
	it('should return 404 if file not found', done => {
		let id = new ObjectID().toHexString();
		request(app)
		.delete(`/files/${id}`)
		.expect(404)
		.end(done)
	});
	it('should return 404 for non-valid ObjectID', done => {
		let id = "NotValidObjectID";
		request(app)
		.delete(`/files/${id}`)
		.expect(404)
		.end(done)
	});
});